import logo from './logo.svg';
import './App.css';
import { render } from '@testing-library/react';


function App(props) {
 return <h1>hello,{props.name} </h1> ;
 }


 const root = ReactDOM.createRoot(document.getElementById('root'));
 const element = <App name="sara"/>; 
 root.render(ele) 

export default App;
